	RETURNING books_borrowing.*;
$$
LANGUAGE sql;

------------------------------------------------------------------------------------------------------
--- Feactures Funciton
------------------------------------------------------------------------------------------------------
CREATE OR REPLACE FUNCTION feature_check_in(_payment_id int)
RETURNS SETOF books_borrowing
AS
$$
	DECLARE
		_copy_id int;
	BEGIN
		UPDATE books_borrowing
		SET priority = '1', payment_status = true
		WHERE payment_id = _payment_id
		RETURNING copy_id INTO _copy_id;
		
		UPDATE book_copies
		SET status = '1'
		WHERE copy_id = _copy_id;
		
		RETURN QUERY 
		SELECT * 
		FROM books_borrowing
		WHERE payment_id = _payment_id;
	END;
$$
LANGUAGE plpgsql;
----------------------------------------------------------------------------

CREATE OR REPLACE FUNCTION feature_check_out(_user_id int, _copy_id int, _staff_id int, _borrow_date date, _time_for_borrowing int)
RETURNS SETOF books_borrowing
AS
$$
	SELECT * FROM addBorrowRecord(_user_id, _copy_id, _staff_id, _borrow_date, _borrow_date + _time_for_borrowing, '0');
$$
LANGUAGE sql;
----------------------------------------------------------------------------

