CREATE OR REPLACE FUNCTION searchReadingHistoryByMaterialID(_id reading_histories.material_id%TYPE)
RETURNS SETOF reading_histories
AS
$$
	SELECT * FROM reading_histories
	WHERE (material_id = _id);

$$
LANGUAGE sql;
----------------------------------------------------------------------------

CREATE OR REPLACE FUNCTION feature_update_copy_status(_copy_id int, _status int, _copy_position varchar)
RETURNS SETOF book_copies
AS
$$
	BEGIN
		RETURN QUERY
			UPDATE book_copies
			SET status = _status, copy_position = _copy_position
			WHERE copy_id = _copy_id
			RETURNING book_copies.*;
	END;
$$
LANGUAGE plpgsql;
----------------------------------------------------------------------------

CREATE OR REPLACE FUNCTION show_revenue_in_period(_start_time date, _end_time date)
RETURNS TABLE(start_time date, end_time date, revenue float)
AS
$$
	SELECT _start_time, _end_time, SUM(m.price)
	FROM books_borrowing AS bb
		INNER JOIN book_copies AS bc ON bb.copy_id = bc.copy_id
		INNER JOIN materials AS m ON bc.book_id = m.material_id
	WHERE bb.borrow_date >= _start_time AND bb.borrow_date <= _end_time AND bb.payment_status = true
$$
LANGUAGE sql;
----------------------------------------------------------------------------
CREATE OR REPLACE FUNCTION number_of_reads_each_materials()
RETURNS TABLE(material_id INT,number_of_reads INT)
AS
$$
	SELECT material_id,COUNT(material_id)
	FROM reading_histories
	GROUP BY material_id
	ORDER BY COUNT(material_id) DESC
$$
LANGUAGE sql;

